import './App.css';
import ListMovies from './components/ListMovies';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';

function App() {
  return (
      <Router>
    <div className="container">
      <Routes>
        <Router path ="/" component= {ListMovies} ></Router>
        <Router path ="/movies" component={ListMovies} ></Router>
      </Routes>

    </div>
    </Router>
  );
}

export default App;
